import React, { Component } from 'react';

class DashboardNav extends Component{
    render(){
        return(
            <nav>
                <ul>
                    <li><Link>1</Link></li>
                    <li><Link>2</Link></li>
                    <li><Link>3</Link></li>
                </ul>
            </nav>
        )
    }
}

export default DashboardNav;
